import './portfolio.scss';
const Portfolio = () => {
  const list = [
    {
      id: 'featured',
      title: 'Featured',
    },
    {
      id: 'web',
      title: 'Web App',
    },
    {
      id: 'mobile',
      title: 'Mobile App',
    },
  ];

  return (
    <>
      <div className="portfolio" id="portfolio">
        <h1>Portfolio</h1>
        <ul>
          <li className="active">Featured</li>
          <li>Web App</li>
          <li>Mobile App</li>
          <li>Design</li>
          <li>Branding</li>
        </ul>
        <div className="container">
          <div className="item">
            <img src="" alt="" />
            <h3>Banking App</h3>
            <span>Testing Purpose Content</span>
            <span>Testing Purpose Content</span>
            <span>Testing Purpose Content</span>
          </div>
        </div>
      </div>
    </>
  );
};

export default Portfolio;
